    // @ts-nocheck
    // @ts-ignore
    var __STORY__ = "import React, { Fragment } from 'react';
import styled, { css } from 'styled-components';

import { Icon } from './Icon';
import { icons } from './shared/icons';

const Meta = styled.div`
  color: #666;
  font-size: 12px;
`;

const Item = styled.li`
  display: inline-flex;
  flex-direction: row;
  align-items: center;
  flex: 0 1 20%;
  min-width: 120px;

  padding: 0px 7.5px 20px;

  svg {
    margin-right: 10px;
    width: 24px;
    height: 24px;
  }

  ${props =>
    props.minimal &&
    css`
      flex: none;
      min-width: auto;
      padding: 0;
      background: #fff;
      border: 1px solid #666;

      svg {
        display: block;
        margin-right: 0;
        width: 48px;
        height: 48px;
      }
    `};
`;

const List = styled.ul`
  display: flex;
  flex-flow: row wrap;
  list-style: none;
`;

export default {
  title: 'Design System/Icon',
  component: Icon,
};

export const Labels = (args) => (
  <Fragment>
    There are {Object.keys(icons).length} icons
    <List>
      {Object.keys(icons).map(key => (
        <Item key={key}>
          <Icon icon={key} aria-hidden />
          <Meta>{key}</Meta>
        </Item>
      ))}
    </List>
  </Fragment>
);

export const NoLabels = (args) => (
  <List>
    {Object.keys(icons).map(key => (
      <Item minimal key={key}>
        <Icon icon={key} aria-label={key} />
      </Item>
    ))}
  </List>
);

NoLabels.storyName = 'no labels';

export const Inline = (args) => (
  <Fragment>
    this is an inline <Icon {...args} /> icon (default)
  </Fragment>
);
Inline.args={
  icon:'facehappy',
  "aria-label":'Happy face',
};

export const Block = (args) =>(
  <Fragment>
    this is a block <Icon {...args} /> icon
  </Fragment>
);
Block.args={
  icon:'facehappy',
  "aria-label":'Happy face',
  block:true
};
";
